import '../App.css';

let pages=['About Us', 'Preventative Measures', 'Top 10 Dangerous Roads', 'Current Weather Map', 'Machine Learning Map'];

function App() {
  return (
    <div className="App-navbar">
        <div>
            Whether Weather
        </div>
        {pages.map((item,index)=>{
            return <div key={index}>{item}</div>
        })}
    </div>
  );
}

export default App;
